syntax = "proto3";

package things_go.enumerate;

option go_package = "github.com/things-go/protogen-saber/protosaber/enumerate";
option java_multiple_files = true;

import "google/protobuf/descriptor.proto";


extend google.protobuf.EnumOptions {
  bool enabled = 1010;
}

extend google.protobuf.EnumValueOptions {
  string mapping = 1011;
}